import React from "react";

const Landing = () => {
  return (
    <div className="container vh-100 d-flex flex-column justify-content-center align-items-center text-center">
      <h1 className="fw-bold text-warning">Welcome to Auction App</h1>
      <p className="lead text-light w-75">
        Buy and sell items through our amazing live auctions!
      </p>
      <a href="/dashboard" className="btn btn-warning mt-3">Start Bidding</a>
    </div>
  );
};

export default Landing;
